export default class extends React.Component {
  render() {
    return (
      <div>
        <h1>Hola mundo</h1>
        <p>Bienvenidos al curso</p>

        <img src="/static/platzi-logo.png" alt="Platzi" />

        <style jsx>{`
          h1 {
            color: red;
          }

          div :global(p) {
            color: green;
          }
        `}</style>

          <style jsx global>{`
            body {
              background: yellow;
            }
          `}</style>
      </div>
    )
  }
}
